import React from 'react'
const Dashboard = (props) => {
    return (
        <>
            <div className="dashboard">
                 <h1>Welcome {props.loggedinuser.first_name}</h1>
                <div className="button" onClick={()=>{localStorage.clear({})}}>Logout</div>
            </div>
        </>
    )
}
export default Dashboard;
